// src/pages/BlogPost.js
import React, { useState, useCallback } from "react";
import { useParams, Link, useNavigate } from "react-router-dom";
import { getPostById } from "../data/blog/index";
import ReactMarkdown from "react-markdown";
import InteractiveDemo from "../components/blog/InteractiveDemo";
import LiveCode from "../components/blog/LiveCode";

// Custom renderer for code blocks
const CodeBlock = ({ className, children }) => {
  const [copied, setCopied] = useState(false);
  const language = className ? className.replace('language-', '') : '';

  const copyToClipboard = useCallback(() => {
    navigator.clipboard.writeText(children);
    setCopied(true);
    setTimeout(() => setCopied(false), 2000);
  }, [children]);

  return (
    <div className="relative group">
      <button
        onClick={copyToClipboard}
        className="absolute top-2 right-2 bg-gray-700 text-white px-2 py-1 rounded text-xs opacity-0 group-hover:opacity-100 transition-opacity"
      >
        {copied ? 'Copied!' : 'Copy'}
      </button>
      <pre className={`bg-gray-900 text-gray-100 p-4 rounded-md overflow-x-auto ${className}`}>
        <code className={language ? `language-${language}` : ''}>
          {children}
        </code>
      </pre>
    </div>
  );
};

export default function BlogPost() {
  const { postId } = useParams();
  const navigate = useNavigate();
  const post = getPostById(postId);

  // If post doesn't exist, redirect to blog page
  React.useEffect(() => {
    if (!post) {
      navigate("/blog");
    }
  }, [post, navigate]);

  if (!post) return null;

  // Custom components for ReactMarkdown
  const components = {
    // Handle code blocks
    code({ node, inline, className, children, ...props }) {
      if (inline) {
        return <code className="bg-gray-200 px-1 rounded text-sm" {...props}>{children}</code>;
      }
      return <CodeBlock className={className}>{children}</CodeBlock>;
    },

    // This allows us to use <InteractiveDemo> tags in markdown
    InteractiveDemo: ({ children, ...props }) => (
      <InteractiveDemo {...props}>{children}</InteractiveDemo>
    ),

    // This allows us to use <LiveCode> tags in markdown
    LiveCode: ({ initialCode }) => <LiveCode initialCode={initialCode} />,
  };

  return (
    <div className="container mx-auto px-4 py-16">
      <div className="mb-8">
        <Link 
          to="/blog" 
          className="text-black hover:underline flex items-center"
        >
          <svg 
            xmlns="http://www.w3.org/2000/svg" 
            className="h-5 w-5 mr-1" 
            viewBox="0 0 20 20" 
            fill="currentColor"
          >
            <path 
              fillRule="evenodd" 
              d="M9.707 14.707a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414l4-4a1 1 0 011.414 1.414L7.414 9H15a1 1 0 110 2H7.414l2.293 2.293a1 1 0 010 1.414z" 
              clipRule="evenodd" 
            />
          </svg>
          Back to All Posts
        </Link>
      </div>

      <article className="max-w-none">
        <h1 className="text-3xl md:text-4xl font-bold text-black mb-4">{post.title}</h1>

        <div className="flex flex-col md:flex-row md:items-center text-gray-600 mb-8">
          <p className="text-sm md:text-base">{post.publication}</p>
          <span className="hidden md:inline mx-2">â€¢</span>
          <p className="text-sm md:text-base">
            {new Date(post.date).toLocaleDateString('en-US', {
              year: 'numeric',
              month: 'long',
              day: 'numeric'
            })}
          </p>
        </div>

        <div className="content text-black prose prose-headings:font-bold prose-headings:text-black prose-p:text-black max-w-none">
          {/* We need to use this approach to safely render the custom components */}
          <ReactMarkdown components={components}>{post.content}</ReactMarkdown>
        </div>
      </article>
    </div>
  );
}
